import React, { Component } from 'react';
import { ProgressBar } from 'react-mdl';

const allSkills = skillsObject.map((skill, index) => {
    return <div key={index} style={{display: 'flex'}}>
        {skill.skillName}
        <ProgressBar style={{ margin: 'auto', width: '75%'}} progress={skill.skillProgress} />
    </div>
})

class RenderSkill extends Component {
    render() {
        return (
            <div>
            {console.log(this.props.skillsObject)}
                <h6 className="language-h6">Languages:</h6>
                        { this.props.skills }
                <h6>Frameworks:</h6>
                        { this.props.skills }
                <h6>Databases:</h6>
                        { this.props.skills }
                <h6>Other:</h6>
                        { this.props.skills }
            </div>
        )
    }
}

export default RenderSkill
